      SELECT ALL col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col2 NOT BETWEEN ( - col1 ) AND + 41 * col1;
  - name: tab1

outputs:
  - name: q2325.out
    data: |
      14
      47
      5
